import { ThreeData } from "@/views/sceneData2";
export default {
  name: "download",
  methods: {
    downFlie: function downFlie() {
      // 创建a标签
      var elementA = document.createElement('a'); //文件的名称为时间戳加文件名后缀

      elementA.download = +new Date() + ".tpl";
      elementA.style.display = 'none'; //生成一个blob二进制数据，内容为json数据

      var blob = new Blob([JSON.stringify(ThreeData)]); //生成一个指向blob的URL地址，并赋值给a标签的href属性

      elementA.href = URL.createObjectURL(blob);
      document.body.appendChild(elementA);
      elementA.click();
      document.body.removeChild(elementA);
    }
  }
};
